import React, { Fragment } from 'react';

const Footer = () => {
	return (
		<Fragment>
			<footer class='border-top bg-light'>
				<div>
					<span class='text-muted'>
						TEAM #1 | CSC648 | SFSU | 2022
					</span>
				</div>
			</footer>
		</Fragment>
	);
};

export default Footer;
